import React, { useState } from 'react'
import "./style.css";
function Login() {
    const initialvalue={email:"",phone:"",pass:"",Pass_conf:""};
    const [fromValue,setFromValue]=useState(initialvalue);
    const hanldValue = (e) => {
        const {name ,value}=e.target;
        setFromValue({...fromValue,[name]:value});
        console.log(fromValue);
    }
    const submitfrom=(e)=>{
        e.preventDefault();
        
        // else{
        //     alert('ðŸ˜Œ Plase fill the Data ðŸ˜Œ');
        // }
    }
  return (
    <>
<div className="container">
	<div className="screen">
		<div className="screen__content">
			<form className="login" action='' onSubmit={submitfrom}>
            <pre>{JSON.st}</pre>
				<div className="login__field">
					<i className="login__icon fas fa-user"></i>
					<input type="email" className="login__input" placeholder=" Email" 
                        value={fromValue.email}
                        onChange={hanldValue}
                    /><br></br>
                    <span></span>
				</div>
                <div className="login__field">
					<i className="login__icon fas fa-user"></i>
					<input type="number" className="login__input" placeholder="Phone Number" 
                        value={fromValue.phone}
                        onChange={hanldValue}
                    /><br></br>
                    <span></span>
				</div>
                <div className="login__field">
					<i className="login__icon fas fa-user"></i>
					<input type="password" className="login__input" placeholder="Password" 
                        value={fromValue.pass}
                        onChange={hanldValue}
                    /><br></br>
                    <span></span>
				</div>
				<div className="login__field">
					<i className="login__icon fas fa-lock"></i>
					<input type="password" className="login__input" placeholder="Password Confirm" 
                        value={fromValue.Pass_conf}
                        onChange={hanldValue}
                    /><br></br>
                    <span></span>
				</div>
				<button className="button login__submit" type='submit'>
					<span className="button__text">Log In Now</span>
				</button>				
			</form>
			<div className="social-login">
				<h3>log in via</h3>
				<div className="social-icons">
					<a href="#" className="social-login__icon fab fa-instagram"></a>
					<a href="#" className="social-login__icon fab fa-facebook"></a>
					<a href="#" className="social-login__icon fab fa-twitter"></a>
				</div>
			</div>
		</div>
		<div className="screen__background">
			<span className="screen__background__shape screen__background__shape4"></span>
			<span className="screen__background__shape screen__background__shape3"></span>		
			<span className="screen__background__shape screen__background__shape2"></span>
			<span className="screen__background__shape screen__background__shape1"></span>
		</div>
        		
	</div>
</div>
    </>
  )
}
export default Login
